//Main data
exports.domain="https://netagrow.cloud";
exports.APP_NAME="Netagrow For Vendors";
exports.LOGO="https://www.netagrow.cloud/uploads/settings/d1e1bbaf-6a44-49b2-974e-e85272e10f8f_logo.jpg";
exports.LOGOWidth=250;
exports.LOGOHeight=250;

//Currency
exports.currency="USD";
exports.currencySign="$";
exports.enableCOD=true;  //Cash on deliver

//Date format
exports.dateTimeFormat="MMMM Do YYYY, h:mm a";
exports.dateFormat="MMMM Do YYYY";

//Registering
exports.disableRegister=false; //Set to true if you want to remove the option to register from mobile app
exports.APP_SECRET="APP_SECRET";


//Optional
//FoodTiger Setup
exports.SINGLE_MODE=false;
exports.SINGLE_MODE_ID=1;
exports.SINGLE_MODE_NAME="Restaurant Name";
exports.MULTI_CITY=true;

//Google setup
exports.GOOGLE_API_KEY="GOOGLE_API_KEY";
exports.queryTypes="address"
exports.queryCountries=['us']; //{['pl', 'fr']}
exports.searchLatitude=null; //{500}
exports.searchLongitude=null; //{51.905070}
exports.searchRadius=null; //{19.458834}
